import React from "react";
import ConCard from "./Con-Card";
import image from "./mask-group-nuo.png"

function Cards(){
    return(
    
    <div className="container" style={{background:"red"}}>
        <div className="row">
            <div className="col-4">
            <ConCard 
                obj={{
                    img:image,
                    name:"ayman",
                    phone:"+684 34546543",
                    email:"sds@gmain.ocom"
                }}
    />
            </div>
        </div>

    </div>
    
    )
}

export default Cards
